		function createCard(number) { //יוצרים את הריבוע בהתחלה
			var gameScreen = stage.getChildByName("gameScreen")
		
			var randomXNumber = Math.floor(Math.random() * (stageW - 200)) + 60
			var baseCard = new lib.card()
			addCardContent(number, baseCard)
			baseCard.x = randomXNumber
			gameScreen.addChild(baseCard)
			baseCard.name = "card" + counter;
		
			fallingCardsArray.push(shuffledCardsArray[number]) // שומרים את כל המידע למערך חדש
			shuffledCardsArray.splice(0, 1) // מוציאים את הקלף שנפל מהמערך הישן
			if (shuffledCardsArray.length == 0) {
				if (firstTrueCard != null) {
					shuffledCardsArray.push(firstTrueCard)
					firstTrueCard = null
				}
			}
			counter++
		}
		
		function addCardContent(number, baseCard) {
			if (typeof shuffledCardsArray[number][0] == "string") {
				baseCard.cradInnerAnimation.cardTxt.text = shuffledCardsArray[number][0]
			} else {
				baseCard.cardTxt = ""
				var cardImage = new shuffledCardsArray[number][0]
				baseCard.cradInnerAnimation.addChild(cardImage)
			}
		}
		
		
		function fall() { //שזה טיקר שקורה כל 24 פריימים לשנייה
			if (createjs.Ticker.paused == false) {
				if (currentKeyPressed != 0) {
					move();
				}
		
				var player = stage.getChildByName("dino")
				var gameScreen = stage.getChildByName("gameScreen")
				//var baseCard = gameScreen.getChildByName("card" + counter-1)
		
				for (i = 1; i <= fallingCardsArray.length; i++) {
		
					var fallingCard = gameScreen.getChildByName("card" + (counter - i));
					//נוסיף לו המהירות שזה באעצם המיקום שלו בציר הויי
					fallingCard.y += speed
					//console.log(fallingCard.y)
					if (fallingCard.y > (stageH / 2) && fallingCard.y <= (stageH / 2) + speed) {
						if (fallingCardsArray.length < 2 && shuffledCardsArray.length != 0) {
							createCard(0);
						}
					} else if (intersect(fallingCard, player)) {
						//console.log("מפסיקים את הטיקר")
						createjs.Ticker.paused = true;
						clearInterval(timeInterval);
		
						return checkQuestion(fallingCard.name, i)
		
					} else if (fallingCard.y >= 600) {
						fallingCard.gotoAndPlay(25);
						//console.log("2מפסיקים את הטיקר")
						createjs.Ticker.paused = true;
						clearInterval(timeInterval);
		
						return checkQuestionNotCatch(fallingCard.name, i)
					}
				}
				if (shuffledCardsArray.length == 0 && fallingCardsArray.length == 0) {
					gameScreen.removeChild(gameScreen.getChildByName(fallingCard)) /
						createEndGameSummaryScreen();
		
				}
		
			}
		}
		
